import ExpenseItem from "./ExpenseItem";

function ExpenseItemList(props){
    return(<div>
        {props.array.forEach(element => {
            return <ExpenseItem title = {element.title} amount = {element.amount} date ={element.date} />
        })}
    </div>);
}

